import React, { FunctionComponent } from 'react';

import { GalleryButton } from '../Button';
import { Title } from '../regular/text';
import { GalleriesPreviewContainer, GalleriesPreviewHeader } from './galleries-preview.style';

const GalleriesPreview: FunctionComponent = () => {
    return (
        <GalleriesPreviewContainer>
            <GalleriesPreviewHeader>
                <Title color="balck">Galleries</Title>
            </GalleriesPreviewHeader>
        </GalleriesPreviewContainer>
    )
}

export default GalleriesPreview;
